import React from 'react';

const Home = () => {
    const style ={
        middle:{
          minHeight: "calc(80vh - 148px)",
          padding: "10px"
        },
    display :{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
    }
    }
  return (
    <>
    <h1  className="container text-center mt-5" >Welcome to My Website</h1>
    <div style={{ ...style.middle, ...style.display }} className="container text-center mt-5">
      <div className="row">
        <div className="col-md-4">
          <h3>Our Services</h3>
          <p>
            Check out our services and see how we can help you achieve your goals.
          </p>
        </div>
        <div className="col-md-4">
          <h3>About Us</h3>
          <p>
            Learn more about our company and our mission to provide quality services.
          </p>
        </div>
        <div className="col-md-4">
          <h3>Contact Us</h3>
          <p>
            Have a question or need assistance? Contact us today!
          </p>
        </div>
      </div>
    </div>
    </>
  );
}

export default Home;
